import React from 'react';
import './App.css';
import Person from './Person/person';

function App() {
  return (
    <div className="App">
      <h1>Title</h1>
      <p>working p</p>
      <Person name="Max" age="28"/>
      <Person name="Manu" age="29"/>
      <Person name="Stephanie" age="30"/>
    </div>
  );
}

export default App;
